import React, { useContext, useEffect ,useState} from 'react'
import { Routes, Route, useNavigate } from "react-router-dom"
import { LoginContext } from './ContextProvider/Context';
import CircularProgress from '@mui/material/CircularProgress';
import Box from '@mui/material/Box';
import Sidebar from '../dashbord/Sidebar';
import Packages from '../dashbord/Packages';
import Fitness from '../dashbord/MyFitness';
import QRCode from '../dashbord/QRCode';
import Profile from '../dashbord/Profile';

const Dashboard = () => {
  const { logindata, setLoginData } = useContext(LoginContext);
  const [data, setData] = useState(false);
  const history = useNavigate();

  const DashboardValid = async () => {
    let token = localStorage.getItem("usersdatatoken");

    const res = await fetch("/validuser", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
        Authorization: token,
      },
    });

    const data = await res.json();

    if (data.status == 401 || !data) {
      history("*");
    } else {
      console.log("user verify");
      setLoginData(data);
      history("/dash");
    }
  };

  useEffect(() => {
    setTimeout(() => {
      DashboardValid();
      setData(true);
    }, 2000);
  }, []);

  return (
    <div className="flex h-screen bg-gray-100">
      <Sidebar />
      <div className="flex-1 p-10">
        {data ? (
          <Routes>
            <Route path="/dash/packages" element={<Packages />} />
            <Route path="/dash/fitness" element={<Fitness />} />
            <Route path="/dash/qrcode" element={<QRCode />} />
            <Route path="/dash/profile" element={<Profile />} />
          </Routes>
        ) : (
          <Box
            sx={{
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              height: "100vh",
            }}
          >
            Loading... &nbsp;
            <CircularProgress />
          </Box>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
